  false,\n\t\"url\": null,\n\t\"notes\": \"NOAA CoastWatch distributes science quality
  wind stress data in zonal, meridional, modulus, and wind stress curl sets.  This
  data begins with wind velocity measurements from the SeaWinds instrument onboard
  NASA's QuikSCAT satellite.  SeaWinds is a microwave scatterometer designed to measure
  surface winds over the global ocean.  NOAA CoastWatch processes wind velocity to
  wind stress and wind stress curl.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
